            <title>React Ranked Voting</title>
        </Head>
        <Navbar/>
        <main className={styles.Layout_main}>
            <div className={styles.Layout_header}>
                <img src={logo} />
                <h2>Welcome to React Ranked Voting App</h2>
            </div>
            {props.children}
        </main>
        <style jsx global>{`
            body {
